import React from "react";

const CelebBiographyDefault = () => {
  return (
    <>
      <h6 className="title">Biography</h6>
      <p className='celeb-biography'>Search above for more information on your favorite celebrity!
      </p>
    </>
  );
};

export default CelebBiographyDefault;
